import React from 'react';
import styles from './Diseño.module.css'

const Diseño = () => {

  return (
    <div className={styles.container}>
      <h1 className={styles.tituloDis}>DISEÑO</h1>
      <p>This is a paragraph of text.</p>
      <section className={styles.tarj}>
        <div className={styles.card}>
          <img src={Nissan} className={styles.cardImg} alt="Nissan" />
          <div className={styles.cardBody}>
            <p className={styles.cardText}>Some quick example text to build on the card title and make up the bulk of the card's content.</p>
          </div>
        </div>
        {/* Agregue más tarjetas aquí */}
      </section>
      <div className={styles.canvaContainer}>
        <iframe 
          title="canva"
          src="https://www.canva.com/design/DAFZyXqR4wQ/view?embed"
          width="100%"
          height="500"
          frameborder="0"
          allowfullscreen="allowfullscreen"
        ></iframe>
      </div>
    </div>
  );
};

export default Diseño;
